import React from 'react'
// Import necessary components from the react-google-maps library
import { withScriptjs, withGoogleMap, GoogleMap, Marker } from "react-google-maps";

// Create a functional component that renders the map
const Map = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      defaultZoom={8}
      defaultCenter={{ lat: -34.397, lng: 150.644 }} // Set default center coordinates
    >
      {/* Add Marker component to show a marker on the map */}
      <Marker position={{ lat: -34.397, lng: 150.644 }} />
    </GoogleMap>
  ))
);

// Wrap your Map component with the Google Maps API script loader
const MapWithAPIKey = props => (
  <Map
    googleMapURL={`https://maps.googleapis.com/maps/api/js?key=${YOUR_API_KEY}&v=3.exp&libraries=geometry,drawing,places`}
    loadingElement={<div style={{ height: "100%" }} />}
    containerElement={<div style={{ height: "400px" }} />}
    mapElement={<div style={{ height: "100%" }} />}
  />
);

export default MapWithAPIKey;
